import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, AppRegistry } from 'react-native';
import { NativeRouter, Route, Link } from "react-router-native";
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Provider} from 'react-redux'
import { createStore } from 'redux';

import Dashboard from './src/Pages/Dashboard';
import PostForm from './src/Pages/Post';
import BroadCast from './src/Pages/Broadcast';
import PostEditor from './src/Pages/PostEditor';
import LocationForm from './src/Pages/Location/LocationForm';

const Stack = createNativeStackNavigator();
const store = createStore()

export default function App() {
  return (
    <Provider store={store}>
      <NavigationContainer>
        <Stack.Navigator animationEnabled={true}>
          <Stack.Screen
              name="Dashboard"
              component={Dashboard}
          />
          <Stack.Screen name="editor" component={PostEditor}></Stack.Screen>
          <Stack.Screen name="post" component={PostForm}></Stack.Screen>
          <Stack.Screen name="broadcast" component={BroadCast}></Stack.Screen>
          <Stack.Screen name="location" component={LocationForm}></Stack.Screen>
        </Stack.Navigator>
      </NavigationContainer>
    </Provider>
  );
}


AppRegistry.registerComponent('MyApp', () => App);
